import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <body>
      <div className="App" height= "100%">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>REACT CRUD APP</h1>

        <input type="text" name="movieName" />
        <input type="text" name="review" />
      </div>
    </body>
  );
}

export default App;
